import Tienda from "./componentes/zonaTienda/tiendaComponente/Tienda";
import Layout from "./UIComponents/Layout";
import Registrov3 from "./componentes/zonaCliente/registroComponente/Registro3";
import Login from "./componentes/zonaCliente/loginComponente/Login";
import { Route, Routes, BrowserRouter } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<Layout><Tienda /></Layout>} />
        <Route path="/registro" element={<Registrov3 />} />
        <Route path="/login" element={<Layout><Login /></Layout>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
